DROP TABLE IF EXISTS `book`;
CREATE TABLE `book` (
  `ID` int(10) NOT NULL AUTO_INCREMENT,
  `book_name` varchar(50) DEFAULT NULL,
  `author` varchar(30) DEFAULT NULL,
  `cover_img` varchar(50) DEFAULT NULL,
  `home_img` varchar(50) DEFAULT NULL,
  `introducation` varchar(20000) DEFAULT NULL,
  `review` int(1) DEFAULT NULL,
  `status_hire` int(10) DEFAULT NULL,
  `type_zu_shou` int(1) NOT NULL,
  `upload_time` date DEFAULT NULL,
  `stadard_number` varchar(13) DEFAULT NULL,
  `delete_flag` int(1) DEFAULT NULL,
  `isbn` varchar(50) DEFAULT NULL,
  `reasons` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8;

