INSERT INTO `book` VALUES (1,'GitHub入门与实践','[日] 大塚弘记,','https://img1.doubanio.com/lpic/s29237757.jpg',NULL,'本书从Git的基本知识和操作方法入手，详细介绍了GitHub的各种功能，GitHub与其他工具或服务的协作，使用GitHub的开发流程以及如何将GitHub引入到企业中。在讲解GitHub的代表功能Pull Request时，本书专门搭建了供各位读者实践的仓库，邀请各位读者进行Pull Request并共同维护。',1,30,0,'2017-06-27','80',0,'978-7-115-39409-5','十分好看'),(2,'HTML5权威指南','[美] Adam Freeman,','https://img3.doubanio.com/lpic/s27169241.jpg',NULL,'《HTML5 权威指南》是系统学习网页设计的权威参考图书。本书分为五部分：第一部分介绍学习本书的预备知识和HTML、CSS 和JavaScript 的最新进展；第二部分讨论HTML 元素，并详细说明了HTML5中新增和修改的元素；第三部分阐述CSS，涵盖了所有控制内容样式的CSS 选择器和属性，并辅以大量代码示例和图示；第四部分介绍DOM，剖析如何用JavaScript 操纵HTML 内容；第五部分讲解Ajax、多媒体和canvas 元素等HTML5 高级特性。\n本书面向初学者和中等水平Web 开发人员，是牢固掌握HTML5、CSS3 和JavaScript 的必读之作。',1,40,0,'2017-06-27','90',0,NULL,'十分好看'),(3,'GitHub入门与实践','[日] 大塚弘记,','https://img1.doubanio.com/lpic/s29237757.jpg',NULL,'本书从Git的基本知识和操作方法入手，详细介绍了GitHub的各种功能，GitHub与其他工具或服务的协作，使用GitHub的开发流程以及如何将GitHub引入到企业中。在讲解GitHub的代表功能Pull Request时，本书专门搭建了供各位读者实践的仓库，邀请各位读者进行Pull Request并共同维护。',1,50,1,'2017-07-07','100',0,'978-7-115-39409-5','十分好看'),(4,'GitHub入门与实践','[日] 大塚弘记,','https://img1.doubanio.com/lpic/s29237757.jpg',NULL,'本书从Git的基本知识和操作方法入手，详细介绍了GitHub的各种功能，GitHub与其他工具或服务的协作，使用GitHub的开发流程以及如何将GitHub引入到企业中。在讲解GitHub的代表功能Pull Request时，本书专门搭建了供各位读者实践的仓库，邀请各位读者进行Pull Request并共同维护。',1,0,0,'2017-07-13',NULL,0,NULL,'十分好看'),(5,'GitHub入门与实践','[日] 大塚弘记,','https://img1.doubanio.com/lpic/s29237757.jpg',NULL,'本书从Git的基本知识和操作方法入手，详细介绍了GitHub的各种功能，GitHub与其他工具或服务的协作，使用GitHub的开发流程以及如何将GitHub引入到企业中。在讲解GitHub的代表功能Pull Request时，本书专门搭建了供各位读者实践的仓库，邀请各位读者进行Pull Request并共同维护。',1,0,0,'2017-07-13',NULL,0,NULL,'十分好看'),(6,'Node.js 实战','赵坤,寸志,雷宗民,吴中骅,','https://img1.doubanio.com/lpic/s27261368.jpg',NULL,'《Node.js 实战（双色）》通过8 个实例讲解了Node.js 在实战开发中的应用，涉及Node.js 常用框架、非关系型数据库、关系型数据库、运维命令和网络安全等内容。章节按照从简单到复杂的难度排序，每一章都通过一个有趣的实例指引读者从头开发一个应用，让读者可以循序渐进地学习Node.js，以及在实战开发中的编程技巧。\n《Node.js 实战（双色）》面向的是有一定Node.js 基础的读者，建议读者把本书当作入门书和进阶书之间的过渡书籍来阅读。当然，《Node.js 实战（双色）》也适合那些有其他服务器编程语言基础，并且想尝试Node.js 新鲜技术的人阅读。\n编辑推荐\n因为CNode社区点击率颇高、粉丝数万