础的读者，建议读者把本书当作入门书和进阶书之间的过渡书籍来阅读。当然，《Node.js 实战（双色）》也适合那些有其他服务器编程语言基础，并且想尝试Node.js 新鲜技术的人阅读。\n编辑推荐\n因为CNode社区点击率颇高、粉丝数万的《一起学node.js》，我认识了《Node.js实战》这本书的几位作者，他们在CNode社区内的贡献、与粉丝跟帖及回复频率，文章更新速度，让我确定了与其合作的想法。很高兴，《Node.js实战》没有成为教条式的入门级别，而是跳出Node.js入门的圈子，真正进入Node.js实战层次。《Node.js实战》的内容架构也是由简入难的，Node.js入门...',1,0,0,'2017-07-13',NULL,0,'978-7-121-22676-2','十分好看'),(12,'Spring MVC学习指南','戴克 (Paul Deck),','https://img3.doubanio.com/lpic/s29405831.jpg',NULL,'Spring MVC是Spring框架中用于Web应用快速开发的一个模块，其中的MVC是Model-View-Controller的缩写。作为当今业界最主流的Web开发框架，Spring MVC已经成为当前最热门的开发技能，同时也广泛用于桌面开发领域。\n本书重在讲述如何通过Spring MVC来开发基于Java的Web应用。全书共计12章，分别从Spring框架、模型2和MVC模式、Spring MVC介绍、控制器、数据绑定和表单标签库、传唤器和格式化、验证器、表达式语言、JSTL、国际化、上传文件、下载文件多个角度介绍了Spring MVC。除此之外，本书还配有丰富的示例以供读者练习和参考。\n本书是一本Spring MVC的教程，内容细致、讲解清晰，非常适合Web开发者和想要使用Spring MVC开发基于Java的Web应用的读者阅读。',1,0,0,'2017-07-26',NULL,0,'978-7-115-38639-7','十分好看');

